import React from 'react';
import WidgetsRenderer from '../WidgetsRenderer/WidgetsRenderer'

export const sidebar = props => {

    if (props.isActive) {
        return (
            <div id='site-sidebar'>
                <WidgetsRenderer { ...props } />
            </div>
        );
    } else return null;
};
